#include <iostream>#include <vector>#include <utility>#include <algorithm>#include <cstdint>#include <limits>using namespace std; // Handy aliases and constantsusing ll = long long;using pii = pair<int, int>;constexpr ll INF64 = (1LL << 62);constexpr int INF32 = (1 << 30);constexpr int MOD = 1'000'000'007; // Debug helper: prints to stderr when LOCAL is defined#ifdef LOCAL#define debug(x) cerr << "[" #x "] = " << (x) << '\n'#else#define debug(x)#endif // Fast IO togglevoid fast_io() {    ios::sync_with_stdio(false);    cin.tie(nullptr);} // Read a vector of size ntemplate <class T>vector<T> read_vec(int n) {    vector<T> v(n);    for (int i = 0; i < n; ++i) cin >> v[i];    return v;} // Print a vector on one linetemplate <class T>void print_vec(const vector<T>& v, char sep = ' ') {    for (int i = 0; i < (int)v.size(); ++i) {        if (i) cout << sep;        cout << v[i];    }    cout << '\n';} // Yes/No helpersvoid yes(bool cond) { cout << (cond ? "YES\n" : "NO\n"); } // Solve a single test case; adjust as needed per problemvoid solve() {    int n;    cin >> n;    auto a = read_vec<int>(n);    vector<int> b(n);    for (int i = 0; i < n; ++i) {        b[i] = (n + 1) - a[i];     }     print_vec(b);} int main() {    fast_io();     int T ;    cin >> T;    while (T--) solve();    return 0;}